import React, { useState} from 'react';

function Joke({data}){
	if(data.question==""){
		data.punchline="";
		
	}
	
	
	return(
	<>
	<h1>{data.question}</h1>
	
	<h2>
	{data.punchline}
	</h2>
	
	</>
	)
	
	
	
}

export default Joke
